import './App.css';
import React from 'react'
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import {Home, About, Contact, NavigationPage} from './components/NavigationPage';



class HelloMessage extends React.Component {
  // constructor (props){
  //   super(props)
  // }
  render() {
    console.log(this.props, ';;;;')
    return (
      <div>
        Salut {this.props.name} {this.props.name2}
      </div>
    );
  }
}


function App() {
  return (
    // <div className="App">
    //   <Header/>
    //   <NavigationPage/>
    //   <FirstPage/>
    //   <HelloMessage name="Thierry" name2="Thierry2"/>
    // </div>
    <Router>
        <div className="App">
          {/* <NavigationPage/> */}

          <div className="navigation">
            <nav id="MyNavBarId" className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
              <button id="NavBarButton" className="navbar-toggler" data-toggle="collapse" data-target="#NavBarCollaps" aria-controls="navbar" aria-expanded="false" aria-label="Toggle navigation">
                <span id="" className="navbar-toggler-icon"></span>
              </button>
                <div id="NavBarCollaps" className="collapse navbar-collapse justify-content-between">
                <a id="MyDivHomeId" className="navbar-brand" href="#Livret" data-toggle="collapse" data-target=".navbar-collapse.show">
                  <span id="" className="">Afficher le Livret de Famille</span>
                </a>
                <a id="MyDivArbreId" className="navbar-brand" href="#Arbre" data-toggle="collapse" data-target=".navbar-collapse.show">
                  <span id="" className="">Afficher l'Arbre de la Famille</span>
                </a>
                <a id="MyDivAlbumId" className="navbar-brand" href="#Album" data-toggle="collapse" data-target=".navbar-collapse.show">
                  <span id="" className="">Afficher l'Album</span>
                </a>
              </div>
            </nav>
          </div>

          <h2>Welcome to React Router Tutorial</h2>
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <ul className="navbar-nav mr-auto">
            <li><Link to={'/home'} className="nav-link"> Home </Link></li>
            <li><Link to={'/contact'} className="nav-link">Contact</Link></li>
            <li><Link to={'/about'} className="nav-link">About</Link></li>
          </ul>
          </nav>
          <hr />
          <div className="container" id="mainId">
            <Routes>
              <Route exact path="/home" element={<Home/>} />
              <Route path="/contact" element={<Contact/>} />
              <Route path="/about" element={<About/>} />
            </Routes>
          </div>
        </div>
      </Router>
  );
}

export default App;
